import style from "./Card.module.css";

const Card = (props) => {
    return(
        <div className={style.CardContainer}>
            <div>
                <p>Name:{props.name}</p>
            </div>
            <div>
                <img src={props.image} alt=""/>
            </div>
            <div>
                <p>Type:{props.type}</p>
            </div>
        </div>
    )
}

export default Card;
